import React from "react";

// import Welcome from "./pages/Welcome";

const App = () => {
  // width = 2 block => height = width/2
  // const height = "90px";
  // const width = "14rem";
  return (
    <div className="min-h-screen flex">
      {/* <Welcome /> */}
      <div className={`grid grid-rows-3 grid-cols-2 w-[12rem] mx-auto gap-3 my-auto`}>
        <div className={`h-[90px]`}>
          <div className="w-full h-full border-4 rounded-full border-black opacity-0 animate-[zoomIn_1s_ease_forwards]"></div>
        </div>
        <div className={`h-[90px]`}>
          <div className="w-full h-full border-4 border-black border-r-0 origin-bottom-left opacity-0 animate-[rotateFixed_1s_0.75s_ease_forwards]"></div>
        </div>
        <div className={`h-[90px]`}>
          <div className="w-full h-full border-4 rounded-full border-black opacity-0 animate-[fadeInLeft_1s_1s_ease_forwards]"></div>
        </div>
        <div className={`h-[90px] relative`}>
          <div className="absolute bottom-0 w-[125px] h-1 bg-pink-500 origin-bottom-left -rotate-45"></div>
        </div>
        <div className="h-[90px]">
          <div className="relative w-full h-full opacity-0 animate-[fadeUp_1s_1.5s_ease_forwards]">
            <div className="absolute h-1 w-full bottom-0 bg-black"></div>
            <div className="absolute h-1 w-[101px] bottom-0 left-0 bg-black origin-bottom-left -rotate-[62deg]"></div>
            <div className="absolute h-1 w-[101px] bottom-0 right-0 bg-black origin-bottom-right rotate-[62deg]"></div>
          </div>
        </div>
        <div className={`h-[90px]`}>
          <div className="w-full h-full border-4 border-t-0 border-r-0 border-black opacity-0 animate-[rotate_1s_1.5s_ease_forwards]"></div>
        </div>
      </div>
    </div>
  );
};

export default App;
